import React from 'react';

class CupCakes extends React.Component{
  render(){
    return(
      <div id="west" className="column effect-hover"><a href="#Cupcakebar">
      <div className="content">
        {/* <i classNameName="fa fa-venus" aria-hidden="true"></i> */}
        <h2>Samar's<span>Cupcake</span></h2>
        <h3>Visit a unicorn world</h3>
        <p className="msgcake">Try our cupcake</p>
      </div>		    
      </a>
    </div>
    )
  }
}

export default CupCakes;
